    false,nt"url": null,nt"notes": "NODC Accession 0112821 includes marine
    mammal observation and biological data collected aboard the LAURENCE M. GOULD during
    cruises LMG0104, LMG0106, LMG0203 and LMG0205 in the South Atlantic Ocean and South
    Pacific Ocean from 2001-05-05 to 2002-09-09. These data include SPECIES IDENTIFICATION
    - ORGANISM LENGTH, MARINE MAMMALS, SPECIES IDENTIFICATION, body fat, ANIMALS - INDIVIDUAL
    - AGE, ANIMALS - INDIVIDUAL - MASS, SPECIES IDENTIFICATION - SEX and girth. The
    instruments used to collect these data include not applicable. These data were collected
    by Daniel Costa of University of California-Santa Cruz as part of Southern Ocean
    GLOBEC. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
    submitted these data to NODC on 2013-07-30.nnThe following is the text of the abstract
    provided by BCO-DMO:nnSeal Studies, Southern Ocean GLOBEC,nGeneral Seal MetadatanReference:
    Laws, R. M., Baird A., Bryden M. M., 2003. (http://globec.whoi.edu/globec-dir/Laws.pdf)
    Size and growth of the crabeater seal Lobodon carcinophagus (Mammalia: Carnivora).
    Journal of Zoology (London) 259, 103-108.nFor additional details on sampling and
    analytical methods see:nBurns, Jennifer M., Daniel P. Costa, Michael A. Fedak, Mark
    A. Hindell, Corey J.A. Bradshaw, Nicholas C. Gales, Birgitte McDonald, Stephan J.
    Trumble, Daniel E. Crocker, 2004. Winter habitat use and foraging behavior of crabeater
    seals along the Western Antarctic Peninsula. (http://dx.doi.org/10.1016/j.dsr2.2004.07.021)
    Deep-Sea Research II vol 51, pp 2279-2303.nnLinks to companion seal files:nSeal
    Physiology (http://globec.whoi.edu/jg/serv/globec/soglobec/seals_phys.html0%7Bdir=globec.whoi.edu/jg/dir/globec/soglobec/,info=globec.whoi.edu/jg/info/globec/soglobec/seals_phys%7D)nSeal
    Morphometrics (http://globec.whoi.edu/jg/serv/globec/soglobec/seals_morphs.html0%7Bdir=globec.whoi.edu/jg/dir/globec/soglobec/,info=globec.whoi.edu/jg/info/globec/soglobec/seals_morphs%7D)nSeal
